import './TODOList.css';
import { useState } from 'react';



function Inputs() {
    return (
        <div className="inputs">
            <h1 className="title">
                To Do List
            </h1>
            <input placeholder="Add your new TODO item..." />
            <button className="add-btn">Add</button>
        </div>
    );// + enter
}

function ListItem({todo}) {
    return (
        <li>
            <div>
                {todo}

                <button>Delete</button>
            </div>
        </li>
    );
}

function List({todos}) {
    const items = [];

    todos.forEach(todo => {
        items.push(<ListItem todo={todo} />);
    });

    return (
        <ul>{items}</ul>
    );
}

function TODOList({ todos }) {
    return (
        <div className="whole-list">
            <Inputs />
            <List
                todos={todos} />
        </div>
    );
}

const TODOS = ["Item1", "Clean", "Write", "Finish"]; // + finished

export default function App() {
    return (
        <TODOList todos={TODOS} />
    );
}
